SET compta_jug = (SELECT count(nom_jugador) FROM jugador WHERE nom_equip = new.nom_equip);
IF compta_jug > 25 THEN
SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Error: Un equip no pot excedir els 26 jugadors';
END IF;
END */;;
