    WHERE camp.nom_equip=nom1;
  SELECT longitud INTO lonc2
    FROM camp
    WHERE camp.nom_equip=nom2;
  SELECT latitut INTO latc2
    FROM camp
    WHERE camp.nom_equip=nom2;    
    
RETURN 6400*ACOS(SIN(RADIANS(latc1)) * SIN(RADIANS(latc2)) + COS(RADIANS(latc1)) * COS(RADIANS(latc2)) * COS(RADIANS(lonc2)-RADIANS(lonc1)));
--  arccos[(sin(lat1) * sin(lat2)) + cos(lat1) * cos(lat2) * cos(long2 – long1)]
-- SQRT(POW((latc1-latc2),2) + POW((lonc1-lonc2),2));
END ;;
