CREATE DEFINER=`root`@`localhost` PROCEDURE `compta_jugadors_equips`()
BEGIN
declare i smallint;
declare imax smallint;
SET i=0;
SET imax=(select count(*) nom_equip from lliga2223.equip);
myloop: LOOP
    SET i=i+1;
    SELECT count(*),jugador.nom_equip FROM lliga2223.jugador inner join lliga2223.equip on jugador.nom_equip = equip.nom_equip where equip.id_equip=i;
    IF i=imax then
            LEAVE myloop;
    END IF;
END LOOP myloop;
SELECT 'I can count until ' as my_text,imax as my_var;
END ;;
